/*
     Insert or Update each of the [Framework] look up default values.
     
     NOTES:
     
     1) This script uses a temporary table, insert or update the values in the temporary table to apply changes; removed values will
     not take affect (by design); values which are removed should also be written into the FrameworkDelete.sql script to remove
     manually any dependencies, but they must also be removed from the temporary table.
*/
BEGIN TRANSACTION

CREATE TABLE #Framework(
    [Id] VARCHAR(25) COLLATE Latin1_General_CI_AS NOT NULL,
    [FrameworkCode] INT NOT NULL,
    [FrameworkName] VARCHAR(500),
    [Level] TINYINT NOT NULL,
    [PathwayCode] INT NOT NULL,
    [PathwayName] VARCHAR(500),
    [ProgrammeType] INT NOT NULL,
    [Title] VARCHAR(500),
    [EffectiveFrom] DATETIME NULL,
    [EffectiveTo] DATETIME NULL
) 


MERGE [dbo].[Framework] [Target] USING #Framework [Source]
ON ([Source].Id COLLATE Latin1_General_CI_AS = [Target].Id)
WHEN MATCHED
    THEN UPDATE SET 
        [Target].[FrameworkCode] = [Source].[FrameworkCode], 
        [Target].[FrameworkName] = [Source].[FrameworkName], 
        [Target].[Level] = [Source].[Level], 
        [Target].[PathwayCode] = [Source].[PathwayCode], 
        [Target].[PathwayName] = [Source].[PathwayName], 
        [Target].[ProgrammeType] = [Source].[ProgrammeType], 
        [Target].[Title] = [Source].[Title], 
        [Target].[EffectiveFrom] = [Source].[EffectiveFrom], 
        [Target].[EffectiveTo] = [Source].[EffectiveTo]

WHEN NOT MATCHED BY TARGET 
    THEN INSERT ([Id], [FrameworkCode], [FrameworkName], [Level], [PathwayCode], [PathwayName], [ProgrammeType], [Title], [EffectiveFrom], [EffectiveTo])
         VALUES (
            [Source].[Id] COLLATE Latin1_General_CI_AS, 
            [Source].[FrameworkCode], 
            [Source].[FrameworkName], 
            [Source].[Level], 
            [Source].[PathwayCode], 
            [Source].[PathwayName], 
            [Source].[ProgrammeType], 
            [Source].[Title], 
            [Source].[EffectiveFrom], 
            [Source].[EffectiveTo]);

COMMIT TRANSACTION